      <text id="9" justification="0" size="4" underlined="false">
        <text> Fare l’UML con i soli attributi e le relazioni e creare un&apos;applicazione JAVA per gestire i calcoli tra frazioni.
Definire la classe Frazione che possiede segno, denominatore e numeratore interi positivi. La classe possiede i seguenti metodi:
•    Frazione(): inizializza gli attributi in modo che la frazione valga +0
•    Frazione(segno, numeratore): suppone 1 al denominatore
•    Frazione(segno, num, den)
•    i get e i set che ritieni necessari (giustifica le scelte)
•    getValore() che restituisce il reale corrispondente (per esempio se un’oggetto frazione ha denominatore 2, numeratore 1 e segno -, getValore()  restituirà -0.5). (1)
•    toString() restituisce una stringa che rappresenti la frazione come segue -1/2
•    equals(f) che dice se la frazione ha lo stesso valore di f (2)

La classe Calcolo è caratterizzata da un’operazione aritmetica (somma, sottrazione, moltiplicazione, divisione) e un insieme di frazioni a cui applicare l’operazione.  Ogni calcolo ha minimo due frazioni, massimo TOT frazioni. La classe possiede i seguenti metodi
•    il costruttore con i parametri che ritieni necessari, giustificando la scelta
•    add(f) che aggiunge una frazione per fare il calcolo (1)
•    getValore() che restituisce il valore numerico del calcolo (2)
•    toString() che visualizza le frazioni intercalate dall’operazione e il risultato finale.
Per esempio +1/2 + -1/2 = 0.0</text>
